import React from "react";

import { CustomButtonContainer } from "./CustomButton.styles";

const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  ...otherProps
}) => <CustomButtonContainer {...props}>{children}</CustomButtonContainer>;

export default CustomButton;
